import React from "react";
import Form from "../Form/Form";

export default function Register() {
	return (
		<>
			<h2>Register</h2>
			<Form>
				<Form.Group controlId="formBasicEmail">
					<Form.Label>Email address</Form.Label>
					<Form.Control type="email" placeholder="Enter email" />
				</Form.Group>
			</Form>
		</>
	);
}
